<strong>RSS:</strong>

[java]

private ArrayList</rssmodel><rssmodel> getRSS()
 {
 String url="http://szymonmotyka.pl/feed/";
 SAXParserFactory factory = SAXParserFactory.newInstance();
 SAXParser saxParser;
 RssParseHandler handler = new RssParseHandler();

try {
 saxParser = factory.newSAXParser();
 saxParser.parse(url, handler);

} catch (ParserConfigurationException e1) {
 e1.printStackTrace();
 } catch (SAXException e1) {
 e1.printStackTrace();
 } catch (IOException e) {
 // TODO Auto-generated catch block
 e.printStackTrace();
 }
 return handler.getItems();
 }

[/java]

Wywołujemy metodę,

rsslist=getRSS();

w onCreateView.

a na końcu dodajemy klasę :

[java]

class RssParseHandler extends DefaultHandler {

 private ArrayList</rssmodel><rssmodel> rssItems;

private RSSModel currentItem;

private boolean parsingTitle;
 private boolean parsingLink;
 private boolean parsingDate;

public RssParseHandler() {
 rssItems = new ArrayList</rssmodel><rssmodel>();
 }
 public ArrayList</rssmodel><rssmodel> getItems() {
 return rssItems;
 }
 @Override
 public void startElement(String uri, String localName, String qName, Attributes attributes) throws SAXException {
 if ("item".equals(qName)) {
 currentItem = new RSSModel();
 } else if ("title".equals(qName)) {
 parsingTitle = true;
 } else if ("link".equals(qName)) {
 parsingLink = true;
 } else if ("pubDate".equals(qName))
 parsingDate=true;

 }
 @Override
 public void endElement(String uri, String localName, String qName) throws SAXException {
 if ("item".equals(qName)) {
 rssItems.add(currentItem);
 currentItem = null;
 } else if ("title".equals(qName)) {
 parsingTitle = false;
 } else if ("link".equals(qName)) {
 parsingLink = false;
 } else if ("pubDate".equals(qName)) {
 parsingDate = false;

 }

 }
 @Override
 public void characters(char[] ch, int start, int length) throws SAXException {
 if (parsingTitle) {
 if (currentItem != null)
 currentItem.setTitle(new String(ch, start, length));
 } else if (parsingLink) {
 if (currentItem != null) {
 currentItem.setLink(new String(ch, start, length));
 parsingLink = false;
 }
 } else if (parsingDate) {
 if (currentItem != null) {
 currentItem.setDate(new String(ch, start, length));
 parsingDate = false;
 }
 }
 }
}

[/java]

